import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { 
  ChartBarIcon, 
  ShoppingBagIcon, 
  UsersIcon, 
  CubeIcon 
} from '@heroicons/react/24/outline';

const AdminDashboard = () => {
  const stats = [
    { name: 'Total Orders', value: '1,234', icon: ShoppingBagIcon, change: '+12%' },
    { name: 'Total Users', value: '5,678', icon: UsersIcon, change: '+8%' },
    { name: 'Total Products', value: '890', icon: CubeIcon, change: '+3%' },
    { name: 'Revenue', value: '$45,678', icon: ChartBarIcon, change: '+15%' },
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-8">Admin Dashboard</h1>
        
        <Routes>
          <Route path="/" element={
            <div>
              {/* Stats Grid */}
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
                {stats.map((stat) => (
                  <div key={stat.name} className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
                    <div className="flex items-center justify-between">
                      <div>
                        <p className="text-sm font-medium text-gray-600">{stat.name}</p>
                        <p className="text-2xl font-bold text-gray-900">{stat.value}</p>
                        <p className="text-sm text-green-600">{stat.change}</p>
                      </div>
                      <div className="p-3 bg-primary-100 rounded-full">
                        <stat.icon className="w-6 h-6 text-primary-600" />
                      </div>
                    </div>
                  </div>
                ))}
              </div>

              {/* Recent Activity */}
              <div className="bg-white rounded-lg shadow-sm border border-gray-200 p-6">
                <h2 className="text-xl font-semibold text-gray-900 mb-4">Recent Activity</h2>
                <div className="text-center py-8">
                  <p className="text-gray-600">Admin features coming soon...</p>
                </div>
              </div>
            </div>
          } />
        </Routes>
      </div>
    </div>
  );
};

export default AdminDashboard;
